    "print(attrition_counts)\n",
    "print(f\"\\nTaxa de Attrition: {(attrition_counts['Yes'] / len(df)) * 100:.2f}%\")  # Calcula percentual de 'Yes'\n",
    "\n",
    "# Análise de missing values\n",
    "print(\"\\n=== ANÁLISE DE VALORES AUSENTES ===\")\n",
    "missing_values = df.isnull().sum()  # Soma valores nulos por coluna\n",
    "if missing_values.sum() == 0:\n",
    "    print(\"Não há valores ausentes no dataset!\")\n",
    "else:\n",
    "    print(missing_values[missing_values > 0])\n",
    "\n",
    "# Aplica capping por IQR em todas as colunas numéricas\\\n",
    "numeric_cols = df.select_dtypes(include=np.number).columns\n",
    "\n",
    "for col in numeric_cols:\n",
    "    Q1 = df[col].quantile(0.25)  # Primeiro quartil (25%)\n",
    "    Q3 = df[col].quantile(0.75)  # Terceiro quartil (75%)\n",
    "    IQR = Q3 - Q1  # Intervalo interquartil\n",
    "\n",
    "    # Define os limites inferior e superior\n",
    "    limite_inferior = Q1 - 1.5 * IQR\n",
    "    limite_superior = Q3 + 1.5 * IQR\n",
    "\n",
    "    # Aplica o capping\n",
    "    df[col] = np.where(df[col] < limite_inferior, limite_inferior,\n",
    "                       np.where(df[col] > limite_superior, limite_superior, df[col]))\n",
    "\n",
    "    print(f\"[{col}] → Capping aplicado entre {limite_inferior:.2f} e {limite_superior:.2f}\")"
