    "            output.append(f\"Verdadeiros Positivos: {tp}\")\n",
    "    \n",
    "        # --- FAIRNESS POR GÊNERO ---\n",
    "        if 'Gender' in X_test_original.columns:\n",
    "            group_col = 'Gender'\n",
    "            group_values = X_test_original[group_col].unique()\n",
