    "                    subgroup_pred = y_pred[idx]\n",
    "                    acc = accuracy_score(subgroup_y, subgroup_pred)\n",
    "                    output.append(f\"{model_name} | {group_col} = {value} | Acurácia: {acc:.4f}\")\n",
